from typing import List


class Empty(Exception):
    pass


class Stack:
    def __init__(self):
        self._data = []

    def is_empty(self):
        return len(self._data) == 0

    def push(self, element):
        self._data.append(element)

    def pop(self):
        if self.is_empty():
            raise Empty("Empty Stack")
        return self._data.pop()

    def top(self):
        if self.is_empty():
            raise Empty("Empty Stack")
        return self._data[-1]


class Solution:
    def evalRPN(self, tokens: List[str]) -> int:
        if not tokens:
            return 0
        elif len(tokens) == 1:
            return int(tokens[0])

        operations = {
            "+": lambda x, y: int(x) + int(y),
            "-": lambda x, y: int(x) - int(y),
            "*": lambda x, y: int(x) * int(y),
            "/": lambda x, y: int(x) / int(y),
        }
        stack = Stack()
        operands_count = 0

        for i in tokens:
            if i in "+-*/":
                if operands_count >= 2:
                    right_operands = stack.pop()
                    left_operands = stack.pop()
                    evaluated = int(operations[i](left_operands, right_operands))
                    stack.push(str(evaluated))
                else:
                    stack.push(i)

                operands_count = 0
            else:
                stack.push(i)
                operands_count += 1

        p = []
        while not stack.is_empty():
            p.append(stack.pop())

        p = p[::-1]
        if len(p) > 1:
            return self.evalRPN(p)

        return p[0]


